import { Button } from '@material-ui/core';
import DeleteOutlineIcon from '@material-ui/icons/DeleteOutline';
import React from 'react';

const Note=(props)=>{
    return(
        <>
            
                <div className="note">
                    <h3>{props.title} </h3>
                    <p>{props.content} </p>
                    <Button><DeleteOutlineIcon className="delete_icon" /> </Button>
                </div>
           
        </>
    )
}
export default Note;
